# Output arrays
Result_real:   .space 4096   # 1024 floats
Result_imag:   .space 4096   # 1024 floats

.text
.globl main
main:
    la a0, Data_real
    la a1, Result_real
    li a2, 1024
    jal copy_array

    la a0, Data_imag
    la a1, Result_imag
    li a2, 1024
    jal copy_array

    la a0, Result_real
    la a1, Result_imag
    li a2, 1024
    jal bit_reversal_pair

    la a0, Result_real
    la a1, Result_imag
    li a2, 1024
    jal fft_iterative

    ebreak

#-------------------------
copy_array:
    mv t0, a0
    mv t1, a1
    mv t2, a2
copy_loop:
    beqz t2, copy_done
    flw ft0, 0(t0)
    fsw ft0, 0(t1)
    addi t0, t0, 4
    addi t1, t1, 4
    addi t2, t2, -1
    j copy_loop
copy_done:
    ret

#-------------------------
bit_reversal_pair:
    addi sp, sp, -24
    sw ra, 20(sp)
    sw s0, 16(sp)
    sw s1, 12(sp)
    sw s2, 8(sp)
    sw s3, 4(sp)

    mv s0, a0        # real array
    mv s1, a1        # imag array
    mv s2, a2        # N
    li s3, 0         # i = 0

bitrev_loop:
    bge s3, s2, bitrev_done

    mv a0, s3
    li a1, 10        # log2(1024) = 10 bits
    jal bit_reverse
    mv t0, a0        # reversed index

    ble t0, s3, bitrev_next

    slli t1, s3, 2
    slli t2, t0, 2

    add t3, s0, t1
    add t4, s0, t2
    flw ft0, 0(t3)
    flw ft1, 0(t4)
    fsw ft1, 0(t3)
    fsw ft0, 0(t4)

    add t3, s1, t1
    add t4, s1, t2
    flw ft0, 0(t3)
    flw ft1, 0(t4)
    fsw ft1, 0(t3)
    fsw ft0, 0(t4)

bitrev_next:
    addi s3, s3, 1
    j bitrev_loop

bitrev_done:
    lw ra, 20(sp)
    lw s0, 16(sp)
    lw s1, 12(sp)
    lw s2, 8(sp)
    lw s3, 4(sp)
    addi sp, sp, 24
    ret

#-------------------------
bit_reverse:
    mv t0, a0
    li t1, 0
    li t2, 0

bitrev_helper_loop:
    beq t2, a1, bitrev_done_helper
    slli t1, t1, 1
    andi t3, t0, 1
    or t1, t1, t3
    srli t0, t0, 1
    addi t2, t2, 1
    j bitrev_helper_loop

bitrev_done_helper:
    mv a0, t1
    ret

#-------------------------
fft_iterative:
    addi sp, sp, -40
    sw ra, 36(sp)
    sw s0, 32(sp)
    sw s1, 28(sp)
    sw s2, 24(sp)
    sw s3, 20(sp)
    sw s4, 16(sp)
    sw s5, 12(sp)
    sw s6, 8(sp)

    mv s0, a0        # real array
    mv s1, a1        # imag array
    mv s2, a2        # N

    li s3, 2         # m = 2 (stage size)

fft_stage_loop:
    bgt s3, s2, fft_done

    srli s4, s3, 1   # m/2

    # Calculate twiddle factor step (512/m)
    li t0, 512
    div t6, t0, s4   # t6 = 512/(m/2) = step size for twiddle factors

    li s5, 0         # group counter

group_loop:
    bge s5, s2, next_stage
    li s6, 0         # butterfly counter

butterfly_loop:
    bge s6, s4, next_group

    # Calculate twiddle factor index
    mul t5, s6, t6   # index = butterfly_num * step
    andi t5, t5, 511 # mod 512 (since we have 512 twiddle factors)

    # Load twiddle factor
    la t0, Twiddle_real
    slli t1, t5, 2
    add t2, t0, t1
    flw ft4, 0(t2)   # W_real

    la t0, Twiddle_imag
    add t2, t0, t1
    flw ft5, 0(t2)   # W_imag

    # Calculate array indices
    add t0, s5, s6   # index1 = group + butterfly
    add t1, t0, s4   # index2 = index1 + m/2

    # Load elements
    slli t2, t0, 2
    slli t3, t1, 2

    add t4, s0, t2
    add t5, s1, t2
    flw ft0, 0(t4)   # real1
    flw ft1, 0(t5)   # imag1

    add t4, s0, t3
    add t5, s1, t3
    flw ft2, 0(t4)   # real2
    flw ft3, 0(t5)   # imag2

    # Butterfly operation
    # temp = W * (real2 + i*imag2)
    fmul.s ft6, ft2, ft4   # real2 * W_real
    fmul.s ft7, ft3, ft5   # imag2 * W_imag
    fsub.s ft6, ft6, ft7   # real part of product

    fmul.s ft7, ft3, ft4   # imag2 * W_real
    fmul.s ft8, ft2, ft5   # real2 * W_imag
    fadd.s ft7, ft7, ft8   # imag part of product

    # Update values
    fadd.s ft8, ft0, ft6   # new real1 = real1 + temp_real
    fadd.s ft9, ft1, ft7   # new imag1 = imag1 + temp_imag
    fsub.s ft10, ft0, ft6  # new real2 = real1 - temp_real
    fsub.s ft11, ft1, ft7  # new imag2 = imag1 - temp_imag

    # Store results
    add t4, s0, t2
    add t5, s1, t2
    fsw ft8, 0(t4)   # store new real1
    fsw ft9, 0(t5)   # store new imag1

    add t4, s0, t3
    add t5, s1, t3
    fsw ft10, 0(t4)  # store new real2
    fsw ft11, 0(t5)  # store new imag2

    addi s6, s6, 1
    j butterfly_loop

next_group:
    add s5, s5, s3
    j group_loop

next_stage:
    slli s3, s3, 1
    j fft_stage_loop

fft_done:
    lw ra, 36(sp)
    lw s0, 32(sp)
    lw s1, 28(sp)
    lw s2, 24(sp)
    lw s3, 20(sp)
    lw s4, 16(sp)
    lw s5, 12(sp)
    lw s6, 8(sp)
    addi sp, sp, 40
    ret